import React from 'react';

function Product (props){
  //console.log("prop",props.data.id)
    return(
    <div className="widget shadow-sm rounded" onClick={props.handler} id = {props.data.id} >
      <h6>{props.data.name}</h6>
      <span>Price</span>
      <h6 style={{float:"right"}}>{props.data.price}</h6>
      <span style={{fontSize:"30px",textDecoration:"bold"}}>></span>

    </div>

    )
}

export default Product;
